import React from 'react';

const Episodes = (ep) => {

    console.log(ep);

    return (
        <div>
            <h1> Episodes</h1>
            {ep.map((episode) => (
                <div>
                    <h1>{episode.title}</h1>

                </div>
            ))}

        </div>
    )
}

export default Episodes;
